import React from "react";
import { Route, Switch } from "react-router-dom";
import NormalRoute from "./AuthRoutingComponents/NormalRoute";
import AuthenticatedRoute from "./AuthRoutingComponents/AuthenticatedRoute";
import MailAuthRoute from "./AuthRoutingComponents/MailAuthRoute";
import ErrorPage from "./AuthRoutingComponents/ErrorPage";
import Home from "../containers/Home";
import Login from "../containers/Login";
import Signup from "../containers/Signup";
import MailResend from "../containers/MailResend";
import MailValidation from "../containers/MailValidation";

//AuthenticatedRoute는 로그인이 필요한 서비스를 나타내며, AppliedRoute는 로그인이 필요하지 않은 서비스를 나타낸다.
export default ({ baseProps }) =>
  <Switch>
    <AuthenticatedRoute path="/" exact component={Home} props={baseProps} />
    <NormalRoute path="/login" exact component={Login} props={baseProps} />
    <NormalRoute path="/signup" exact component={Signup} props={baseProps} />
    <MailAuthRoute path="/mail-resend" exact component={MailResend} props={baseProps} />
    <NormalRoute path="/mail-validation/*" exact component={MailValidation} props={baseProps} />
    <Route component={ErrorPage} />
</Switch>;
